import Nav from "./NavxF/Nav";
import "./App.css";

const Home = () => {
  return (
  
   
    <div className="">
      


      <div id="custom-controls-gallery" class=" relative w-full  " data-carousel="slide">
    <div class=" h-max overflow-hidden w-full rounded-lg md:h-96">
         
        <div class="hidden duration-700 ease-in-out" data-carousel-item>
            <img src="https://4kwallpapers.com/images/walls/thumbs_3t/7282.jpg" class="absolute block max-w-full h-auto -translate-x-1/2 -translate-y-1/2 top-1/2 left-1/2" alt=""/>
        </div>
        
        <div class="hidden duration-700 ease-in-out" data-carousel-item="active">
            <img src="https://4kwallpapers.com/images/walls/thumbs_3t/16041.jpg" class="absolute block max-w-full h-auto -translate-x-1/2 -translate-y-1/2 top-1/2 left-1/2" alt=""/>
        </div>
        
        <div class="hidden duration-700 ease-in-out" data-carousel-item>
            <img src="https://4kwallpapers.com/images/walls/thumbs_3t/3722.jpg" class="absolute block max-w-full h-auto -translate-x-1/2 -translate-y-1/2 top-1/2 left-1/2" alt=""/>
        </div>
        
        <div class="hidden duration-700 ease-in-out" data-carousel-item>
            <img src="https://4kwallpapers.com/images/walls/thumbs_3t/3722.jpg" class="absolute block max-w-full h-auto -translate-x-1/2 -translate-y-1/2 top-1/2 left-1/2" alt=""/>
        </div>

        <div class="hidden duration-700 ease-in-out" data-carousel-item>
            <img src="https://4kwallpapers.com/images/walls/thumbs_3t/3722.jpg" class="absolute block max-w-full h-auto -translate-x-1/2 -translate-y-1/2 top-1/2 left-1/2" alt=""/>
        </div>
    </div>
   
</div>

  
    </div>
  );
};

export default Home;
